import React, { Component } from 'react';
import MyComponent from './MyComponent'

class App extends Component{
    constructor(props){
        super(props);

        this.state = {
            title: 'App title',
            list: [1, 2, 3]
        };

        this.onClick = this.onClick.bind(this)
    }

    onClick(){
        this.setState({
            title: "New app title"
        });

    }
    render(){
        return (
            <div className= "App">
                <h1>{this.state.title}</h1>
                <div onClick={this.onClick}>click here!</div>
                <MyComponent
                    title={2}
                    name = "Zachary"
                ></MyComponent>
            </div>
        )
    }
}

export default App;
